import React from "react";

function Nav() {
    return (
        <header>
            <nav className="nav">
                <img src="logo192.png" alt="react-logo" className="nav-logo" />
                <ul className="nav-items">
                    <li>Tutorial</li>
                    <li>About Us </li>
                    <li>Contact </li>
                </ul>
            </nav>
        </header>
    );
}
export default Nav;
